import React from 'react'
import { connect } from 'react-redux';
import { keycloakAuth, insertSpace } from '../../redux';

function createSpace({ spaceData, authData, insertSpace, keycloakAuth }) {
  return (
    <form onSubmit={() => {insertSpace(authData.kc.token)}}>
      <label for="name">Name:</label><br/>
      <input type="text" id="name" name="name"/><br/>
      <label for="description">Description:</label><br/>
      <input type="text" id="description" name="description"/><br/>
      <input type="submit" value="Add Space" />
    </form>
  )
}

const mapStateToProps = state => {
    return {
        spaceData: state.space,
        authData: state.auth
    }
}

const mapDispatchToProps = dispatch => {
    return {
        insertSpace: (token ,space) => dispatch(insertSpace(token, space)),
        keycloakAuth: () => dispatch(keycloakAuth())
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(createSpace)
